import React from 'react'
import { BounceLoader, BarLoader, BeatLoader } from 'react-spinners'
import './App.css';

function App() {
  return (
    <div className="App">
      <br />
      <BounceLoader size={24} color='' loading />
      <br />
      <br />
      <BarLoader loading />
      <br />
      <br />
      <BeatLoader loading />
    </div>
  );
}

export default App;
